import "../styling/category.css";
import { Row, Col, Container } from "react-bootstrap";
import necklace from "../assets/necklace-thumbnail.jpg";
import earrings from "../assets/earrings-thumbnail.jpg";
import rings from "../assets/rings-thumbnail.jpg";
import bracelets from "../assets/bracelets-thumbnail.jpg";

export const Category = () => {
  return (
    <div className="category-container">
      <h3>Popular Categories</h3>
      <Container fluid>
        <Row>
          <Col sm={6} md={2} >
            <div className="category">
              <img src={rings} alt="rings" className="img-fluid" />
            </div>
          </Col>
          <Col sm={6} md={2} >
            <div className="category">Necklaces</div>
          </Col>
          <Col sm={6} md={2} >
            <div className="category">Earrings</div>
          </Col>
          <Col sm={6} md={2} >
            <div className="category">Bracelets</div>
          </Col>
          <Col sm={6} md={2} >
            <div className="category">Custom</div>
          </Col>
        </Row>
      </Container>
    </div>
  );
};
